procedure(obj, config)
{		
	SYSTEM = _root.core.system;
	CONSOLE = SYSTEM.console;
	WEB = _root.lib.web;

	componentConfig = config.componentConfig;

	tag = componentConfig.tag;
	startTag = "<".concat(tag).concat(">");
	endTag = "</".concat(tag).concat(">");

	elementTag = componentConfig.elementTag;
	startElementTag = "<".concat(elementTag).concat(">");
	endElementTag = "</".concat(elementTag).concat(">");


	html = startTag;
	//iterate elements
	fieldNames = SYSTEM.object.listFields(obj);
	for(i=0;i.lt(fieldNames.size());i.inc(1))
	{
		html = html.concat(startElementTag);

		fieldName = fieldNames.get(i);
		element = SYSTEM.object.getChild(obj, fieldName);

		elementHtml = _self.renderObject(element, config.elementConfig);

		if(SYSTEM.isNull(config.elementConfig))
		{	
			CONSOLE.println("elementConfig is null".concat(config._objectName));
		}
		else
		{	
			CONSOLE.println("elementConfig is not null");
		}

		html = html.concat(elementHtml);

		html =  html.concat(endElementTag);
	}

	html =  html.concat(endTag);
	_result = html;
}

procedure(target, config)
{
	SYSTEM = _root.core.system;
	CONSOLE = SYSTEM.console;
	COMPONENTS = _root.lib.web.components;

	//use its own config if exists
	selfConfig = SYSTEM.object.getMetaField(target, "html");	
	if(SYSTEM.isNull(selfConfig).isFalse())
	{
		config = selfConfig;
	}

	if(SYSTEM.isNull(config).isFalse())
	{
		component = config.component;
		if(SYSTEM.isNull(component).isFalse())
		{
			_result = component.toHtml(target,null);
		}
		else
		{
			component = config.generatedComponent;
			if(SYSTEM.isNull(component).isFalse())
			{
				_result = component.toHtml(target);
			}
			else
			{
				//try to generate component from clue
				if(SYSTEM.isNull(config.componentName).isFalse())
				{

					_result = _self.renderByStandardComponent(target, config);
				}
			}


		}		
	}
	//_root.core.system.console.println("html=".concat(_result));
}

