procedure()
{
	SYSTEM = _root.core.system;
	CONSOLE = SYSTEM.console;

	MAX_INACTIVE_TIME = 3;
//check all devices
	keyList = _self.deviceRoster.getKeyList();
	for(i=0;i.lt(keyList.size());i.inc(1))
	{
		key = keyList.get(i);
		isActive = _self.activeWirelessMacMap.contains(key);

		absentTimes = _self.deviceRoster.get(key);
		if(isActive){
			if(absentTimes.gt(MAX_INACTIVE_TIME))
			{			
				//inactive to active transent
				hostname = _self.getHostName(key);
				msg = hostname.concat(" is online");
				CONSOLE.println(msg);
				//_self.jack.sendEmail(msg,"haha");
			}
			//clear absent times
			_self.deviceRoster.put(key,0);
		}
		else
		{
			if(absentTimes.equals(MAX_INACTIVE_TIME))
			{				
				//active to inactive notification
				hostname = _self.getHostName(key);
				msg = hostname.concat(" is offline");
				CONSOLE.println(msg);
				//_self.jack.sendEmail(msg,"haha");
			}
			_self.deviceRoster.put(key,absentTimes.plus(1));
		}
	}




}

procedure()
{
	SYSTEM = _root.core.system;

	roster = _self.deviceRoster;

	//scan DHCP DB
	keyList = _self.hostMap.getKeyList();
	for(i=0;i.lt(keyList.size());i.inc(1))
	{
		key = keyList.get(i);
		if(roster.contains(key).isFalse())
		{
			roster.put(key,0);
		}

	}

	//scan active wireless clients
	keyList = _self.activeWirelessMacMap.getKeyList();
	for(i=0;i.lt(keyList.size());i.inc(1))
	{
		key = keyList.get(i);
		if(roster.contains(key).isFalse())
		{
			roster.put(key,0);
		}

	}
}

